import React, { useEffect, useState } from "react";

function DoadorList() {
  const [doadores, setDoadores] = useState([]);

  useEffect(() => {
    // Ajuste a URL de acordo com o endpoint do seu back-end
    fetch("http://localhost:8080/doadores")
      .then((res) => res.json())
      .then((data) => setDoadores(data))
      .catch((err) => console.error("Erro ao listar doadores:", err));
  }, []);

  return (
    <div>
      <h2>Lista de Doadores</h2>
      <ul>
        {doadores.map((d) => (
          <li key={d.cpf}>
            {d.cpf} - {d.nome} ({d.tipoSanguineo})
          </li>
        ))}
      </ul>
    </div>
  );
}

export default DoadorList;
